import React from "react";
import s from './MyPosts.module.css';

const MyPosts = () => {
    return (
        <div className={s.create_post}>
            <h2>My Posts</h2>
            <textarea name="" id="" cols="" rows="5">Something write...</textarea><br/>
            <button>Create</button>
        </div>
    );
}

export default MyPosts;
